column64:
 ; ; ; ; ; ;After a day of traveling, upon checking in, the guy at the front desk repeatedly tried to pre-sell me breakfast for 3 days - for 4 people. The breakfast was terrible so I’m really glad I didn’t fall for that. 
I stay at Hyatt properties and others for business travel all the time. I expect the same professional treatment when traveling with my family and I certainly did not get that.; ;I wanted the same experience I get as a business traveler everywhere else I go. I realize that this is not as big of a city, but customer service should be just the same. 

In addition to the aforementioned issues - parking was a nightmare in this location and very cumbersome to access. The suggested solution was to pay for parking elsewhere. Really?; ; ; ; ; ; ; ; ; ; ; ; ; ; ;

